import React from "react";
import './App.scss';

export default class Button extends React.Component {
    constructor(props) {
        super ( props );
    }

    render() {
        return (
            <div className={"button bold sm-font " + this.props.backgroundClass}>
                {this.props.text}
            </div>)
    }
}
